import { ReactComponent as EditIcon } from '../../../../assets/images/icon-edit.svg';
import { ReactComponent as MoreIcon } from '../../../../assets/images/icon-more.svg';

import './Body.scss';

export const Body = () => {
    return (
        <div className="app-body">
            <h3>Title Section</h3>
            <ul className='ct__list'>
                <li className='ct__list-item'>
                    <div className='left'>
                        <input type="checkbox" />
                        <p className="task">Task description</p>
                    </div>
                    <div className="right">
                        <EditIcon/>
                        <MoreIcon/>
                    </div>
                </li>
            </ul>
        </div>
    );
}
